import React from 'react';
import Header from '../layout/Header';
import Footer from '../layout/Footer';

//component
//component + props
//component + props 생략
//component + props + 객체
//component + props + 반복문

function Info({text}) {
    return(
    <div className="main__cont">
        <div>{text}</div>
    </div>
    );
}
//map 은 배열에서 사용된다.
const textInfo = [
    {text : "WE PROVIDE"},
    {text : "VISUAL CODING"},
    {text : "SOLUTIONS"},
    {text : "FOR YOU WEBS"}
]

function Main() {
    return (
      <div id="wrap">
        <Header/>
        <section id="mainCont">
        <div className="main__cont">
            {textInfo.map((el)=>(
                <Info text={el.text}/>
            ))}
        </div>
        </section>
        <Footer/>
      </div>
    );
  }

export default Main;
